import { Routes, BrowserRouter, Route} from 'react-router-dom';
import './App.css';
import Home from './pages/home'

function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={Home} />
          <Route />
        </Routes>
    </BrowserRouter>
  );
}

export default App;
